@Component({
  selector: 'app-command-success',
  templateUrl: './command-success.component.html',
  styleUrls: ['./command-success.component.scss']
})
export class CommandSuccessComponent {

}
<div class="card mt-5">
    <div class="card-header" style="background: cadetblue">
        <h4>Command Success</h4>
    </div>
    <div class="card-body">
        <h6>Your command is passed successfully !</h6>
        <br><hr>
        <strong>Thank you for your confidence.</strong>
    </div>
</div>
